import React from 'react'

const students = [{
    name:"Abhiraj",
    rollno:"01"
},
{
    name:"naveen",
    rollno:"02"
}
]

const ClassIA = () => {

  return (
    <>
    {
        students.map((student) => <div key={student.rollno}>
            <div>
                {student.name} {student.rollno}
            </div>
            </div>)
    }
    </>
  )
}

export default ClassIA
